import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';

class calculator extends Component {
  state = {  }
  render() { 
    return (
      <div className="container mt-5 w-25">
          <div className="card">
            <div className="card-body">
              <div className="row">
                <div className="col-12 text-center border rounded-pill">
                 <h3>CALCULATOR using ReactJS</h3>
                </div>
                <div className="col-12 mt-2">
                  <input className="form-control" readOnly></input>
                </div>
                <div className="col-12 mt-2">
                  <button className="btn btn-secondary mr-3">+</button>
                  <button className="btn btn-secondary mr-3">-</button>
                  <button className="btn btn-secondary mr-3">x</button>
                  <button className="btn btn-secondary mr-3">/</button>
                  <button className="btn btn-secondary ">C</button>
                </div>
              </div>
            </div>
          </div>
      </div>
      );
  }
}

export default calculator;
